LOCK TABLES `TEXTO` WRITE;
/*!40000 ALTER TABLE `TEXTO` DISABLE KEYS */;
INSERT INTO `TEXTO` VALUES (1,'<p>La <strong>introducción</strong> es la sección inicial de un texto en la que se contextualiza y brinda al lector la información previa del tema que será tratado en el desarrollo posterior y en las <a href=\"https://www.ejemplos.co/15-ejemplos-de-conclusion/\" target=\"_blank\">conclusiones</a>.</p><p>Se utilizan introducciones para comenzar un libro, un ensayo, un <a href=\"https://www.ejemplos.co/ejemplos-de-articulo-cientifico/\" target=\"_blank\">artículo</a>, un <a href=\"https://www.ejemplos.co/proyecto-de-investigacion-informacion-ejemplos/\" target=\"_blank\">texto de investigación</a>, una biografía, etc.</p><p>La introducción es la primera oportunidad que tiene el autor de dirigirse al lector y, por lo tanto, el momento de brindarle las herramientas conceptuales para su lectura o para aclararle información pertinente sobre lo que está por leer.</p><p>En una introducción se suelen utilizar <a href=\"https://www.ejemplos.co/nexos-de-orden/\" target=\"_blank\">nexos de orden</a>, para organizar el contenido que va a ir anticipando el texto. Su extensión puede variar, pero siempre la introducción está ubicada al inicio. En un artículo breve puede no ser más que un párrafo, mientras que en una tesis académica comúnmente consistirá en varias páginas de discurso fluido.</p>',1),(2,'<p>La <strong>justificación</strong> a la parte de un <a href=\"https://www.ejemplos.co/proyecto-de-investigacion-informacion-ejemplos/\" target=\"_blank\">proyecto de investigación</a> que expone las razones que motivaron a realizar esa investigación. La justificación es la sección en la que se explica la importancia y los motivos que llevaron al investigador a realizar el trabajo.</p><p>En la justificación se explica al lector por qué y para qué se investigó el tema elegido. En forma general, los motivos que el investigador puede dar en una justificación pueden ser que su trabajo permite construir o refutar teorías; aportar un nuevo enfoque o perspectiva sobre el tema; contribuir a la solución de un problema concreto (social, económico, ambiental, etc.) que afecta a determinadas personas; generar datos <a href=\"https://www.ejemplos.co/12-ejemplos-de-conocimiento-empirico/\" target=\"_blank\">empíricos</a> significativos y reutilizables; aclarar las causas y consecuencias de un determinado fenómeno de interés; entre otras.</p><p>Entre los criterios utilizados para redactar una justificación se toman en cuenta la utilidad de la investigación para otros académicos o bien para otros sectores sociales (funcionarios públicos, empresas, sectores de la sociedad civil), la trascendencia en el tiempo que puede tener, el aporte de nuevas herramientas o técnicas de investigación, la actualización de conocimientos preexistentes, entre otros. Además, el lenguaje debe ser formal y <a href=\"https://www.ejemplos.co/10-ejemplos-de-textos-descriptivos/\" target=\"_blank\">descriptivo</a>.</p>',2);
/*!40000 ALTER TABLE `TEXTO` ENABLE KEYS */;
